import React from 'react';
import {Link} from 'react-router-dom';


function Navbar() {
  return (
    <div className='navbar'>

      <div className='rightSide'>
      <li>
          <Link to="/pokedex">PokeDex</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
      </div>
    </div>
  )
}

export default Navbar
